  const { Component, pageProps } = this.props;
  const appTheme = {
    colors: {
      turquoise: '#45B5AA',
      mimosa: '#F0C05A',
      ceruleanBlue: '#9BB7D4',
      trueRed: '#BF1932',
      sandDollar: '#DECDBE',


    }
  };
  return (
    <Container>
      <ThemeProvider theme={appTheme}>
        <Component {...pageProps} />
      </ThemeProvider>
    </Container>
  );
}

export default App;
